  <p>I am a Web Developer and I'm {Math.floor(Math.random() * 33)} years old</p>
  <p>I am a Web Developer and I'm {Math.floor(Math.random() * 20)} years old</p>

  <Person>Yes</Person>
</div>
    );
  } 
}
export default App;
